                        "type": 1,
                        "menuCode": "material/corp/1106140232/library",
                        "children": [],
                        "publicMenu": 0,
                        "helpLinkPath": null,
                        "helpContent": "<p>1.如果材料库中缺少所需分类，可联系分公司物资部，申请添加，分公司做需添加的分类汇总后，联系发送给公司物资部，由公司物资部在平台上添加所需分类；</p>\n<p>2.<span class=\"lake-fontsize-11\" style=\"font-size: 11px;\">云筑网的一种材料只能绑定一体化的一种材料且绑定之后不可修改。但是一体化的一种材料可以绑定云筑网的多种材料。如果云筑网的材料绑定错误了，只有去云筑网新建材料后重新进行绑定。</span></p>"
