  created() {
    let findItem = this.waterfallData.find((item)=>{
            return item.menuName == '业务中心';
        });
    let waterfallData = [];
    if(findItem && findItem.children){
        waterfallData = findItem.filter((item)=>{
            return item.menuName != "欢迎页面"
        })
    }
    let newWaterfallData =  new Array(this.split)
    waterfallData.forEach((el, i) => {
     if(!newWaterfallData[i % this.split]){
        newWaterfallData[i % this.split] = [];
     }
      newWaterfallData[i % this.split].push(el);
    });
    this.newWaterfallData = newWaterfallData;
  },
  mounted() {

  },
  methods: {
    // 跳转页面
    _toPage(menuItem){
        this.$router.push({path:menuItem.linkPath})
    }

  },
